var title_f3_40_3718="EPS tracings AVRT into atrial tachycardia";
var content_f3_40_3718=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F65336&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F65336&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electrophysiology study (EPS) tracings of surface and intracardiac electrograms showing degeneration of orthodromic atrioventricular reciprocating tachycardia (AVRT) into atrial tachycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 428px; height: 331px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Surface ECG leads I, AVF, and VI and intracardiac electrograms are simultaneously recorded. The first three QRS complexes represent an orthodromic atrioventricular reentrant tachycardia (AVRT). The QRS complexes are narrow and there is retrograde activation of the atrium (P) which, based upon timing with the vertical line after the second QRS complex, begins at the distal coronary sinus (DCS) which is the site of earliest atrial activation and is consistent with a left lateral accessory pathway. After the third complex, the vertical line indicates atrial activation at the proximal coronary sinus (PCS) which is premature and has a different morphology (A'). This atrial premature beat initiates a rapid atrial tachycardia (*) and atrial activity now precedes the QRS complex. The atrial tachycardia has a wide complex because of antegrade conduction via the accessory pathway.",
"    <div class=\"footnotes\">",
"     HRA: high right atrium; HBEP: proximal His Bundle electrogram; HBED: distal His Bundle electrogram; MCS: mid coronary sinus; RVA: right ventricular apex.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
