"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?15/23/15730?source=related_link\">",
"      Patient information: Atopic dermatitis (eczema) (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?31/38/32354?source=related_link\">",
"      Patient information: Contact dermatitis (including latex dermatitis) (Beyond the Basics)",
"     </a>",
"    </li>",
